import React, { useState, useEffect, useCallback } from 'react';
import './App.css';

function App() {
  const [apodData, setApodData] = useState(null);
  const [marsPhotos, setMarsPhotos] = useState([]);
  const [epicImages, setEpicImages] = useState([]);
  const [neoData, setNeoData] = useState([]);
  const [nasaLibrary, setNasaLibrary] = useState([]);

  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [sol, setSol] = useState(1000); // Default Martian day

  // Fetch Mars Rover photos using useCallback
  const fetchMarsPhotos = useCallback(async () => {
    try {
      const response = await fetch(`/api/mars-photos?sol=${sol}`);
      const data = await response.json();
      setMarsPhotos(data.photos);
    } catch (error) {
      console.error('Error fetching Mars Rover photos:', error);
      setError(error); // Set error state if fetch fails
    }
  }, [sol]); // Include sol as a dependency

  // Fetch all data when the component mounts
  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      setError(null); // Reset error state on new fetch

      try {
        // Fetch APOD data
        const apodResponse = await fetch('/api/apod');
        const apodResult = await apodResponse.json();
        setApodData(apodResult);

        // Fetch Mars Rover photos
        await fetchMarsPhotos(); // Call this function

        // Fetch EPIC images
        const epicResponse = await fetch('/api/epic');
        const epicResult = await epicResponse.json();
        setEpicImages(epicResult);

        // Fetch Near Earth Objects
        const neoResponse = await fetch('/api/neo');
        const neoResult = await neoResponse.json();
        setNeoData(neoResult.near_earth_objects);

        // Fetch NASA Library images
        const libraryResponse = await fetch('/api/nasa-library');
        const libraryResult = await libraryResponse.json();
        setNasaLibrary(libraryResult.collection.items);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(error); // Set error state if fetch fails
      } finally {
        setLoading(false); // Set loading to false after all requests
      }
    };

    fetchData();
  }, [sol, fetchMarsPhotos]); // Include fetchMarsPhotos in the dependency array

  return (
    <div className="App">
      <h1>NASA Data Explorer</h1>

      {/* Display loading indicator */}
      {loading && <div className="spinner">Loading...</div>}

      {/* Display error message if there is an error */}
      {error && <p className="error">Error fetching data: {error.message}</p>}

      {/* APOD Section */}
      {apodData && (
        <div className="apod-container">
          <h2>{apodData.title}</h2>
          <img src={apodData.url} alt="APOD" />
          <p>{apodData.explanation}</p>
        </div>
      )}

      {/* Mars Rover Photos Section */}
      <div className="mars-photos">
        <h2>Mars Rover Photos</h2>
        <input 
          type="number" 
          value={sol} 
          onChange={(e) => setSol(e.target.value)} 
          placeholder="Enter Martian Sol" 
        />
        <button onClick={fetchMarsPhotos}>Fetch Photos</button>
        {marsPhotos.map((photo) => (
          <div key={photo.id}>
            <img src={photo.img_src} alt={`Mars ${photo.id}`} />
          </div>
        ))}
      </div>

      {/* EPIC Images Section */}
      <div className="epic-images">
        <h2>Earth Polychromatic Imaging Camera (EPIC) Images</h2>
        {epicImages.map((image, index) => (
          <div key={index}>
            <img 
              src={`https://epic.gsfc.nasa.gov/archive/natural/${image.date}/jpg/${image.image}.jpg`} 
              alt={`EPIC ${index}`} 
            />
          </div>
        ))}
      </div>

      {/* Near Earth Objects Section */}
      <div className="neo-data">
        <h2>Near Earth Objects</h2>
        {neoData.map((neo) => (
          <div key={neo.id}>
            <p><strong>Name:</strong> {neo.name}</p>
          </div>
        ))}
      </div>

      {/* NASA Image and Video Library Section */}
      <div className="nasa-library">
        <h2>NASA Image and Video Library</h2>
        {nasaLibrary.map((item) => (
          <div key={item.data[0].nasa_id}>
            <img src={item.links[0].href} alt={item.data[0].title} />
            <p>{item.data[0].title}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
